import { Outlet, Navigate, NavLink } from "react-router-dom";
import { useIsAuthenticated } from 'react-auth-kit'
// common
import NavBar from '../common/NavBar';

import Header from "../common/Header";
import Footer from "../common/Footer";


function PrivateLayout() {
  const isAuthenticated = useIsAuthenticated()

  if (!isAuthenticated()) {
    // Redirect to login
    console.log("valid Redirect to login");
    return (
      <Navigate to="/" replace />
    );
  }

  return (
    <>
      {/* <div>
        <NavBar />

        <main>
          <Outlet />
        </main>
      </div> */}
      <div className="app_private">
        <Header />
        <main className="mt-70" style={{ minHeight: 300 }}>
          <div className="container">
            <div className="float-end">
            <ul className="list-inline agentdashboard">
              <li className="list-inline-item">
                <NavLink  to="/dash">Dashboard</NavLink>
              </li>
              <li className="list-inline-item">
                <NavLink  to="/dash/agents">Agents</NavLink>
              </li>
              <li className="list-inline-item">
                <NavLink  to="/dash/projects">Projects</NavLink>
              </li>
              <li className="list-inline-item">
                <NavLink  to="/dash/sales">Sales</NavLink>
              </li>
              <li className="list-inline-item">
                <NavLink  to="/dash/invitations">Invitations</NavLink>
              </li>
              {/* <li className="list-inline-item">
                <NavLink  to="/dash/settings">settings</NavLink>
              </li> */}

            </ul>
            </div>

            <Outlet />

          </div>


        </main>
        <Footer />

      </div>

    </>
  );
}

export default PrivateLayout;
